import React from 'react';
import { 
    Button,
    Card,
    CardActions,
    CardContent,
    Dialog,
    DialogActions,
    DialogContent,
    DialogContentText,
    DialogTitle,
    Grid,
    Typography,
} from "@material-ui/core";

const MyCard =()=>{

    const getMatchCart=()=>{
        return (
            <Card>
                <CardContent>
                <Grid container>
                    <Grid item>
                        <Typography>First Team</Typography>
                    </Grid>
                    <Grid item>
                    <Typography>First Team</Typography>
                    </Grid>
                    <Grid item>
                    <Typography>First Team</Typography>
                    </Grid>

                </Grid>
                </CardContent>
                <CardActions>
                    <Button variant="contained" color="primary">
                      Show Detail
                    </Button>
                    <Button variant="contained" color="primary">
                        {new Date().toString()}
                    </Button>
                    
                </CardActions>

            </Card>
        );
    };

    return getMatchCart();

   
};
export default MyCard;
